import React from 'react';


class Case2 extends React.Component{
  render() {
    return (
      <div className={"rond"+this.props.aorb} style={{backgroundColor: this.props.bg}} onClick={() => {
        this.props.lol(this.props.oc,this.props.bg);
      }}>
      </div>
    );
  }
}

export default Case2;
